import React from 'react';
import { Link, useNavigate } from 'react-router-dom';
import { useAuth } from '../contexts/AuthContext';
import { FaUser, FaSignOutAlt, FaSignInAlt, FaUserPlus, FaCog } from 'react-icons/fa';

const Navbar = () => {
  const { user, isAuthenticated, logout } = useAuth();
  const navigate = useNavigate();

  const handleLogout = () => {
    logout();
    navigate('/');
  };

  return (
    <nav style={{
      background: 'rgba(255, 255, 255, 0.1)',
      backdropFilter: 'blur(10px)',
      borderBottom: '1px solid rgba(255, 255, 255, 0.2)',
      padding: '1rem 2rem',
      position: 'sticky',
      top: 0,
      zIndex: 100
    }}>
      <div style={{
        display: 'flex',
        justifyContent: 'space-between',
        alignItems: 'center',
        maxWidth: '1200px',
        margin: '0 auto'
      }}>
        {/* Logo */}
        <Link to="/" style={{ textDecoration: 'none', color: 'white', display: 'flex', alignItems: 'center', gap: '0.5rem' }}>
          <div style={{ display: 'flex', alignItems: 'center', gap: '0.3rem' }}>
            {/* Apple Icon */}
            <div style={{
              width: '30px',
              height: '30px',
              backgroundColor: '#FF6B35',
              borderRadius: '50% 50% 50% 50% / 60% 60% 40% 40%',
              position: 'relative'
            }}>
              <div style={{
                width: '8px',
                height: '6px',
                backgroundColor: '#4a4a4a',
                position: 'absolute',
                top: '-2px',
                left: '50%',
                transform: 'translateX(-50%)',
                borderRadius: '0 0 50% 50%'
              }}></div>
            </div>

            {/* Leaf Icon */}
            <div style={{
              width: '30px',
              height: '30px',
              backgroundColor: '#4ECDC4',
              borderRadius: '0 100% 0 100%',
              transform: 'rotate(45deg)'
            }}></div>

            {/* Heart Icon */}
            <div style={{
              width: '30px',
              height: '30px',
              backgroundColor: '#96CEB4',
              position: 'relative',
              transform: 'rotate(-45deg)'
            }}>
              <div style={{
                width: '15px',
                height: '24px',
                backgroundColor: '#96CEB4',
                borderRadius: '15px 15px 0 0',
                position: 'absolute',
                left: '15px',
                transform: 'rotate(-45deg)',
                transformOrigin: '0 100%'
              }}></div>
              <div style={{
                width: '15px',
                height: '24px',
                backgroundColor: '#96CEB4',
                borderRadius: '15px 15px 0 0',
                position: 'absolute',
                left: '15px',
                transform: 'rotate(45deg)',
                transformOrigin: '0 100%'
              }}></div>
            </div>
          </div>
          <div>
            <div style={{ 
              fontSize: '1.2rem', 
              fontWeight: 'bold',
              lineHeight: '1',
              letterSpacing: '1px'
            }}>
              WELLNESS IN
            </div>
            <div style={{ 
              fontSize: '1.2rem', 
              fontWeight: 'bold',
              lineHeight: '1',
              letterSpacing: '1px'
            }}>
              THE SCHOOLS
            </div>
          </div>
        </Link>

        {/* Navigation Links */}
        <div style={{ display: 'flex', alignItems: 'center', gap: '1rem' }}>
          {isAuthenticated ? (
            <>
              {/* User Menu */}
              <div style={{ display: 'flex', alignItems: 'center', gap: '1rem' }}>
                <span style={{ color: 'rgba(255, 255, 255, 0.8)' }}>
                  Welcome, {user?.username}!
                </span>

                {/* Profile Link */}
                <Link to="/profile" className="btn btn-secondary" style={{ padding: '8px 16px', fontSize: '0.9rem' }}>
                  <FaUser style={{ marginRight: '0.5rem' }} />
                  Profile
                </Link>

                {/* Admin Link (if admin) */}
                {user?.role === 'admin' && (
                  <Link to="/admin" className="btn btn-success" style={{ padding: '8px 16px', fontSize: '0.9rem' }}>
                    <FaCog style={{ marginRight: '0.5rem' }} />
                    Admin
                  </Link>
                )}

                {/* Logout Button */}
                <button onClick={handleLogout} className="btn btn-danger" style={{ padding: '8px 16px', fontSize: '0.9rem' }}>
                  <FaSignOutAlt style={{ marginRight: '0.5rem' }} />
                  Logout
                </button>
              </div>
            </>
          ) : (
            <>
              {/* Login Link */}
              <Link to="/login" className="btn btn-primary" style={{ padding: '8px 16px', fontSize: '0.9rem' }}>
                <FaSignInAlt style={{ marginRight: '0.5rem' }} />
                Login
              </Link>

              {/* Register Link */}
              <Link to="/register" className="btn btn-secondary" style={{ padding: '8px 16px', fontSize: '0.9rem' }}>
                <FaUserPlus style={{ marginRight: '0.5rem' }} />
                Register
              </Link>
            </>
          )}
        </div>
      </div>
    </nav>
  );
};

export default Navbar;
